import React from "react";
import "./header.css";

function Icon() {
  return (
    <>
      <div className="icon">
        <a href="">
          <i class=""></i>
        </a>
      </div>
    </>
  );
}

const Header = (props) => {
  return (
    <div>
      <div className="wraper">
        <span>Welcome to Zuiz Business Services</span>
        <div className="icon-container">
          <div className="bar"></div>
          <a href="https://www.youtube.com">Follow Us</a>
          <div className="icons">
            <Icon
              link="https://www.instagram.com"
              faClass="fa-brands fa-instagram"
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
